css:
.btn.btn-subtle {
  background-color: transparent;
  background-image: none;
  border: none;
}
.btn-subtle.icon:before {
  margin-right: 0;
}
.nuclide-test-runner-panel-toolbar {
  height: 28px;
  line-height: 18px;
  /* -5px to accomodate drag handle from the panel component. */
  padding: 1px 10px 6px;
}
.nuclide-test-runner-panel-toolbar progress[value] {
  /* See https://github.com/atom/atom/issues/6646. */
  -webkit-animation: none;
}
.nuclide-test-runner-panel {
  flex: 1;
  /* Let .nuclide-test-runner-panel position itself relative to this container. */
  position: relative;
}
.nuclide-test-runner-console {
  bottom: 0;
  /* Let the `<atom-pane-container>` fill the height since it already has `flex: 1` applied. */
  display: flex;
  position: absolute;
  top: 28px;
  width: 100%;
}
.nuclide-test-runner-panel .nuclide-tree-root,
.nuclide-test-runner-panel .nuclide-tree-root-placeholder {
  /* Make tree in the panel scroll rather than overflow its parent. */
  overflow: auto;
  padding-left: 10px;
  padding-right: 10px;
}
